export const fetchUserData = async () => {
    try {
      const response = await fetch('https://api.example.com/user');
      if (!response.ok) {
        throw new Error('Failed to fetch user data');
      }
      return response.json();
    } catch (error) {
      throw new Error('Failed to fetch user data');
    }
  };
